import{_ as e,o as i,c as r,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 59.1-200 Prohibited practices.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-200.md","filePath":"vacode/59.1-200.md"}'),o={name:"vacode/59.1-200.md"},t=a('<h1 id="§-59-1-200-prohibited-practices" tabindex="-1">§ 59.1-200 Prohibited practices. <a class="header-anchor" href="#§-59-1-200-prohibited-practices" aria-label="Permalink to &quot;§ 59.1-200 Prohibited practices.&quot;">​</a></h1><p>A. The following fraudulent acts or practices committed by a supplier in connection with a consumer transaction are hereby declared unlawful:</p><ol><li><p>Misrepresenting goods or services as those of another;</p></li><li><p>Misrepresenting the source, sponsorship, approval, or certification of goods or services;</p></li><li><p>Misrepresenting the affiliation, connection, or association of the supplier, or of the goods or services, with another;</p></li><li><p>Misrepresenting geographic origin in connection with goods or services;</p></li><li><p>Misrepresenting that goods or services have certain quantities, characteristics, ingredients, uses, or benefits;</p></li><li><p>Misrepresenting that goods or services are of a particular standard, quality, grade, style, or model;</p></li><li><p>Advertising or offering for sale goods that are used, secondhand, repossessed, defective, blemished, deteriorated, or reconditioned, or that are &quot;seconds,&quot; irregulars, imperfects, or &quot;not first class,&quot; without clearly and unequivocally indicating in the advertisement or offer for sale that the goods are used, secondhand, repossessed, defective, blemished, deteriorated, reconditioned, or are &quot;seconds,&quot; irregulars, imperfects or &quot;not first class&quot;;</p></li><li><p>Advertising goods or services with intent not to sell them as advertised, or with intent not to sell at the price or upon the terms advertised.</p></li></ol><p>In any action brought under this subdivision, the refusal by any person, or any employee, agent, or servant thereof, to sell any goods or services advertised or offered for sale at the price or upon the terms advertised or offered, shall be prima facie evidence of a violation of this subdivision. This paragraph shall not apply when it is clearly and conspicuously stated in the advertisement or offer by which such goods or services are advertised or offered for sale, that the supplier or offeror has a limited quantity or amount of such goods or services for sale, and the supplier or offeror at the time of such advertisement or offer did in fact have or reasonably expected to have at least such quantity or amount for sale;</p><ol start="9"><li><p>Making false or misleading statements of fact concerning the reasons for, existence of, or amounts of price reductions;</p></li><li><p>Misrepresenting that repairs, alterations, modifications, or services have been performed or parts installed;</p></li><li><p>Misrepresenting by the use of any written or documentary material that appears to be an invoice or bill for merchandise or services previously ordered;</p></li><li><p>Notwithstanding any other provision of law, using in any manner the words &quot;wholesale,&quot; &quot;wholesaler,&quot; &quot;factory,&quot; or &quot;manufacturer&quot; in the supplier&#39;s name, or to describe the nature of the supplier&#39;s business, unless the supplier is actually engaged primarily in selling at wholesale or in manufacturing the goods or services advertised or offered for sale;</p></li><li><p>Using in any contract or lease any liquidated damage clause, penalty clause, or waiver of defense, or attempting to collect any liquidated damages or penalties under any clause, waiver, damages, or penalties that are void or unenforceable under any otherwise applicable laws of the Commonwealth, or under federal statutes or regulations;</p></li></ol><p>13a. Failing to provide to a consumer, or failing to use or include in any written document or material provided to or executed by a consumer, in connection with a consumer transaction any statement, disclosure, notice, or other information however characterized when the supplier is required by 16 C.F.R. Part 433 to so provide, use, or include the statement, disclosure, notice, or other information in connection with the consumer transaction;</p><ol start="14"><li><p>Using any other deception, fraud, false pretense, false promise, or misrepresentation in connection with a consumer transaction;</p></li><li><p>Violating any provision of § <a href="/vacode/3.2-6509/">3.2-6509</a>, <a href="/vacode/3.2-6512/">3.2-6512</a>, <a href="/vacode/3.2-6513/">3.2-6513</a>, <a href="/vacode/3.2-6513.1/">3.2-6513.1</a>, <a href="/vacode/3.2-6514/">3.2-6514</a>, <a href="/vacode/3.2-6515/">3.2-6515</a>, <a href="/vacode/3.2-6516/">3.2-6516</a>, or <a href="/vacode/3.2-6519/">3.2-6519</a> is a violation of this chapter;</p></li><li><p>Failing to disclose all conditions, charges, or fees relating to:</p></li></ol><p>a. The return of goods for refund, exchange, or credit. Such disclosure shall be by means of a sign attached to the goods, or placed in a conspicuous public area of the premises of the supplier, so as to be readily noticeable and readable by the person obtaining the goods from the supplier. If the supplier does not permit a refund, exchange, or credit for return, he shall so state on a similar sign. The provisions of this subdivision shall not apply to any retail merchant who has a policy of providing, for a period of not less than 20 days after date of purchase, a cash refund or credit to the purchaser&#39;s credit card account for the return of defective, unused, or undamaged merchandise upon presentation of proof of purchase. In the case of merchandise paid for by check, the purchase shall be treated as a cash purchase and any refund may be delayed for a period of 10 banking days to allow for the check to clear. This subdivision does not apply to sale merchandise that is obviously distressed, out of date, post season, or otherwise reduced for clearance; nor does this subdivision apply to special order purchases where the purchaser has requested the supplier to order merchandise of a specific or unusual size, color, or brand not ordinarily carried in the store or the store&#39;s catalog; nor shall this subdivision apply in connection with a transaction for the sale or lease of motor vehicles, farm tractors, or motorcycles as defined in § <a href="/vacode/46.2-100/">46.2-100</a>;</p><p>b. A layaway agreement. Such disclosure shall be furnished to the consumer (i) in writing at the time of the layaway agreement, or (ii) by means of a sign placed in a conspicuous public area of the premises of the supplier, so as to be readily noticeable and readable by the consumer, or (iii) on the bill of sale. Disclosure shall include the conditions, charges, or fees in the event that a consumer breaches the agreement;</p><p>16a. Failing to provide written notice to a consumer of an existing open-end credit balance in excess of $5 (i) on an account maintained by the supplier and (ii) resulting from such consumer&#39;s overpayment on such account. Suppliers shall give consumers written notice of such credit balances within 60 days of receiving overpayments. If the credit balance information is incorporated into statements of account furnished consumers by suppliers within such 60-day period, no separate or additional notice is required;</p><ol start="17"><li><p>If a supplier enters into a written agreement with a consumer to resolve a dispute that arises in connection with a consumer transaction, failing to adhere to the terms and conditions of such an agreement;</p></li><li><p>Violating any provision of the Virginia Health Club Act, Chapter 24 (§ <a href="/vacode/59.1-294/">59.1-294</a> et seq.);</p></li><li><p>Violating any provision of the Virginia Home Solicitation Sales Act, Chapter 2.1 (§ <a href="/vacode/59.1-21.1/">59.1-21.1</a> et seq.);</p></li><li><p>Violating any provision of the Automobile Repair Facilities Act, Chapter 17.1 (§ <a href="/vacode/59.1-207.1/">59.1-207.1</a> et seq.);</p></li><li><p>Violating any provision of the Virginia Lease-Purchase Agreement Act, Chapter 17.4 (§ <a href="/vacode/59.1-207.17/">59.1-207.17</a> et seq.);</p></li><li><p>Violating any provision of the Prizes and Gifts Act, Chapter 31 (§ <a href="/vacode/59.1-415/">59.1-415</a> et seq.);</p></li><li><p>Violating any provision of the Virginia Public Telephone Information Act, Chapter 32 (§ <a href="/vacode/59.1-424/">59.1-424</a> et seq.);</p></li><li><p>Violating any provision of § <a href="/vacode/54.1-1505/">54.1-1505</a>;</p></li><li><p>Violating any provision of the Motor Vehicle Manufacturers&#39; Warranty Adjustment Act, Chapter 17.6 (§ <a href="/vacode/59.1-207.34/">59.1-207.34</a> et seq.);</p></li><li><p>Violating any provision of § <a href="/vacode/3.2-5627/">3.2-5627</a>, relating to the pricing of merchandise;</p></li><li><p>Violating any provision of the Pay-Per-Call Services Act, Chapter 33 (§ <a href="/vacode/59.1-429/">59.1-429</a> et seq.);</p></li><li><p>Violating any provision of the Extended Service Contract Act, Chapter 34 (§ <a href="/vacode/59.1-435/">59.1-435</a> et seq.);</p></li><li><p>Violating any provision of the Virginia Membership Camping Act, Chapter 25 (§ <a href="/vacode/59.1-311/">59.1-311</a> et seq.);</p></li><li><p>Violating any provision of the Comparison Price Advertising Act, Chapter 17.7 (§ <a href="/vacode/59.1-207.40/">59.1-207.40</a> et seq.);</p></li><li><p>Violating any provision of the Virginia Travel Club Act, Chapter 36 (§ <a href="/vacode/59.1-445/">59.1-445</a> et seq.);</p></li><li><p>Violating any provision of §§ <a href="/vacode/46.2-1231/">46.2-1231</a> and <a href="/vacode/46.2-1233.1/">46.2-1233.1</a>;</p></li><li><p>Violating any provision of Chapter 40 (§ <a href="/vacode/54.1-4000/">54.1-4000</a> et seq.) of Title 54.1;</p></li><li><p>Violating any provision of Chapter 10.1 (§ <a href="/vacode/58.1-1031/">58.1-1031</a> et seq.) of Title 58.1;</p></li><li><p>Using the consumer&#39;s social security number as the consumer&#39;s account number with the supplier, if the consumer has requested in writing that the supplier use an alternate number not associated with the consumer&#39;s social security number;</p></li><li><p>Violating any provision of Chapter 18 (§ <a href="/vacode/6.2-1800/">6.2-1800</a> et seq.) of Title 6.2;</p></li><li><p>Violating any provision of § <a href="/vacode/8.01-40.2/">8.01-40.2</a>;</p></li><li><p>Violating any provision of Article 7 (§ <a href="/vacode/32.1-212/">32.1-212</a> et seq.) of Chapter 6 of Title 32.1;</p></li><li><p>Violating any provision of Chapter 34.1 (§ <a href="/vacode/59.1-441.1/">59.1-441.1</a> et seq.);</p></li><li><p>Violating any provision of Chapter 20 (§ <a href="/vacode/6.2-2000/">6.2-2000</a> et seq.) of Title 6.2;</p></li><li><p>Violating any provision of the Virginia Post-Disaster Anti-Price Gouging Act, Chapter 46 (§ <a href="/vacode/59.1-525/">59.1-525</a> et seq.);</p></li><li><p>Violating any provision of Chapter 47 (§ <a href="/vacode/59.1-530/">59.1-530</a> et seq.);</p></li><li><p>Violating any provision of § <a href="/vacode/59.1-443.2/">59.1-443.2</a>;</p></li><li><p>Violating any provision of Chapter 48 (§ <a href="/vacode/59.1-533/">59.1-533</a> et seq.);</p></li><li><p>Violating any provision of Chapter 25 (§ <a href="/vacode/6.2-2500/">6.2-2500</a> et seq.) of Title 6.2;</p></li><li><p>Violating the provisions of clause (i) of subsection B of § <a href="/vacode/54.1-1115/">54.1-1115</a>;</p></li><li><p>Violating any provision of § <a href="/vacode/18.2-239/">18.2-239</a>;</p></li><li><p>Violating any provision of Chapter 26 (§ <a href="/vacode/59.1-336/">59.1-336</a> et seq.);</p></li><li><p>Selling, offering for sale, or manufacturing for sale a children&#39;s product the supplier knows or has reason to know was recalled by the U.S. Consumer Product Safety Commission. There is a rebuttable presumption that a supplier has reason to know a children&#39;s product was recalled if notice of the recall has been posted continuously at least 30 days before the sale, offer for sale, or manufacturing for sale on the website of the U.S. Consumer Product Safety Commission. This prohibition does not apply to children&#39;s products that are used, secondhand or &quot;seconds&quot;;</p></li><li><p>Violating any provision of Chapter 44.1 (§ <a href="/vacode/59.1-518.1/">59.1-518.1</a> et seq.);</p></li><li><p>Violating any provision of Chapter 22 (§ <a href="/vacode/6.2-2200/">6.2-2200</a> et seq.) of Title 6.2;</p></li><li><p>Violating any provision of § <a href="/vacode/8.2-317.1/">8.2-317.1</a>;</p></li><li><p>Violating subsection A of § <a href="/vacode/9.1-149.1/">9.1-149.1</a>;</p></li><li><p>Selling, offering for sale, or using in the construction, remodeling, or repair of any residential dwelling in the Commonwealth, any drywall that the supplier knows or has reason to know is defective drywall. This subdivision shall not apply to the sale or offering for sale of any building or structure in which defective drywall has been permanently installed or affixed;</p></li><li><p>Engaging in fraudulent or improper or dishonest conduct as defined in § <a href="/vacode/54.1-1118/">54.1-1118</a> while engaged in a transaction that was initiated (i) during a declared state of emergency as defined in § <a href="/vacode/44-146.16/">44-146.16</a> or (ii) to repair damage resulting from the event that prompted the declaration of a state of emergency, regardless of whether the supplier is licensed as a contractor in the Commonwealth pursuant to Chapter 11 (§ <a href="/vacode/54.1-1100/">54.1-1100</a> et seq.) of Title 54.1;</p></li><li><p>Violating any provision of Chapter 33.1 (§ <a href="/vacode/59.1-434.1/">59.1-434.1</a> et seq.);</p></li><li><p>Violating any provision of § <a href="/vacode/18.2-178/">18.2-178</a>, <a href="/vacode/18.2-178.1/">18.2-178.1</a>, or <a href="/vacode/18.2-200.1/">18.2-200.1</a>;</p></li><li><p>Violating any provision of Chapter 17.8 (§ <a href="/vacode/59.1-207.45/">59.1-207.45</a> et seq.);</p></li><li><p>Violating any provision of subsection E of § <a href="/vacode/32.1-126/">32.1-126</a>;</p></li><li><p>Violating any provision of § <a href="/vacode/54.1-111/">54.1-111</a> relating to the unlicensed practice of a profession licensed under Chapter 11 (§ <a href="/vacode/54.1-1100/">54.1-1100</a> et seq.) or Chapter 21 (§ <a href="/vacode/54.1-2100/">54.1-2100</a> et seq.) of Title 54.1;</p></li><li><p>Violating any provision of § <a href="/vacode/2.2-2001.5/">2.2-2001.5</a>;</p></li><li><p>Violating any provision of Chapter 5.2 (§ <a href="/vacode/54.1-526/">54.1-526</a> et seq.) of Title 54.1;</p></li><li><p>Violating any provision of § <a href="/vacode/6.2-312/">6.2-312</a>;</p></li><li><p>Violating any provision of Chapter 20.1 (§ <a href="/vacode/6.2-2026/">6.2-2026</a> et seq.) of Title 6.2;</p></li><li><p>Violating any provision of Chapter 26 (§ <a href="/vacode/6.2-2600/">6.2-2600</a> et seq.) of Title 6.2;</p></li><li><p>Violating any provision of Chapter 54 (§ <a href="/vacode/59.1-586/">59.1-586</a> et seq.);</p></li><li><p>Knowingly violating any provision of § <a href="/vacode/8.01-27.5/">8.01-27.5</a>; and</p></li><li><p>Failing to make available a conspicuous online option to cancel a recurring purchase of a good or service as required by § <a href="/vacode/59.1-207.46/">59.1-207.46</a>.</p></li></ol><p>B. Nothing in this section shall be construed to invalidate or make unenforceable any contract or lease solely by reason of the failure of such contract or lease to comply with any other law of the Commonwealth or any federal statute or regulation, to the extent such other law, statute, or regulation provides that a violation of such law, statute, or regulation shall not invalidate or make unenforceable such contract or lease.</p><p>1977, c. 635; 1979, c. 304; 1981, c. 205; 1983, c. 173; 1986, c. 432; 1987, cc. 462 to 464; 1988, cc. 24, 534; 1989, cc. 689, 703; 1990, c. 584; 1991, cc. 300, 605, 608, 630, 654; 1992, cc. 278, 545, 768; 1993, cc. 455, 760; 1994, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0261" target="_blank" rel="noreferrer">261</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0400" target="_blank" rel="noreferrer">400</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0655" target="_blank" rel="noreferrer">655</a>; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0010" target="_blank" rel="noreferrer">10</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0848" target="_blank" rel="noreferrer">848</a>; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0880" target="_blank" rel="noreferrer">880</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0901" target="_blank" rel="noreferrer">901</a>; 2002, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0217" target="_blank" rel="noreferrer">217</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0897" target="_blank" rel="noreferrer">897</a>; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0800" target="_blank" rel="noreferrer">800</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1003" target="_blank" rel="noreferrer">1003</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0784" target="_blank" rel="noreferrer">784</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0790" target="_blank" rel="noreferrer">790</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0798" target="_blank" rel="noreferrer">798</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0817" target="_blank" rel="noreferrer">817</a>; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0269" target="_blank" rel="noreferrer">269</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0303" target="_blank" rel="noreferrer">303</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0640" target="_blank" rel="noreferrer">640</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0861" target="_blank" rel="noreferrer">861</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0399" target="_blank" rel="noreferrer">399</a>; 2008, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0294" target="_blank" rel="noreferrer">294</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0791" target="_blank" rel="noreferrer">791</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0842" target="_blank" rel="noreferrer">842</a>; 2009, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0321" target="_blank" rel="noreferrer">321</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0359" target="_blank" rel="noreferrer">359</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0376" target="_blank" rel="noreferrer">376</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0699" target="_blank" rel="noreferrer">699</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0700" target="_blank" rel="noreferrer">700</a>; 2010, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0477" target="_blank" rel="noreferrer">477</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0713" target="_blank" rel="noreferrer">713</a>; 2011, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0615" target="_blank" rel="noreferrer">615</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0396" target="_blank" rel="noreferrer">396</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0459" target="_blank" rel="noreferrer">459</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0591" target="_blank" rel="noreferrer">591</a>; 2017, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0011" target="_blank" rel="noreferrer">11</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0016" target="_blank" rel="noreferrer">16</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0727" target="_blank" rel="noreferrer">727</a>; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0299" target="_blank" rel="noreferrer">299</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0704" target="_blank" rel="noreferrer">704</a>; 2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0291" target="_blank" rel="noreferrer">291</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0292" target="_blank" rel="noreferrer">292</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0521" target="_blank" rel="noreferrer">521</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0412" target="_blank" rel="noreferrer">412</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0438" target="_blank" rel="noreferrer">438</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0481" target="_blank" rel="noreferrer">481</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0785" target="_blank" rel="noreferrer">785</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1198" target="_blank" rel="noreferrer">1198</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1215" target="_blank" rel="noreferrer">1215</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1250" target="_blank" rel="noreferrer">1250</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1258" target="_blank" rel="noreferrer">1258</a>; 2021, Sp. Sess. I, c. <a href="https://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0485" target="_blank" rel="noreferrer">485</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0351" target="_blank" rel="noreferrer">351</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0557" target="_blank" rel="noreferrer">557</a>.</p>',13),n=[t];function l(s,p,c,h,f,g){return i(),r("div",null,n)}const v=e(o,[["render",l]]);export{u as __pageData,v as default};
